import React, { Component } from 'react';

var value = 0;

export class Boton extends Component {
    ButtonFunction () {
        value ++;
    }

  render() {
    return (
      <div>
        <button onClick='ButtonFunction' >Agregar 1</button>
        <span>{value}</span>
      </div>
    )
  }
}

export default Boton;
